        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](14, "1. \uBAA9\uC801\n\uC774 \uC57D\uAD00\uC740 \uAC15\uC6D0\uB3C4\uAC00 \uC6B4\uC601\uD558\uB294 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD568\uC5D0 \uC788\uC5B4 \uC774\uC6A9\uC870\uAC74 \uBC0F \uC808\uCC28, \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC640 \uC774\uC6A9\uC790\uAC04\uC758 \uAD8C\uB9AC \uBC0F \uC758\uBB34\uC5D0 \uAD00\uD55C \uC0AC\uD56D\uACFC \uAE30\uD0C0 \uD544\uC694\uD55C \uC0AC\uD56D\uC744 \uADDC\uC815\uD568\uC744 \uBAA9\uC801\uC73C\uB85C \uD569\uB2C8\uB2E4.\n\n2. \uC57D\uAD00\uC758 \uD6A8\uB825 \uBC0F \uBCC0\uACBD\n\u2460 \uC57D\uAD00\uC758 \uB0B4\uC6A9\uC740 \uBCC4\uB3C4\uC758 \uD1B5\uC9C0 \uC5C6\uC774 \uC218\uC2DC\uB85C \uAC31\uC2E0\uB420 \uC218 \uC788\uACE0, \uC774\uC6A9\uC790\uB294 \uC5B8\uC81C\uB4E0\uC9C0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0\uC11C \uC57D\uAD00\uC758 \uCD5C\uC2E0 \uB0B4\uC6A9\uC744 \uD655\uC778\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\u2461 \uC774 \uC57D\uAD00\uC740 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0 \uADF8 \uB0B4\uC6A9\uC744 \uACF5\uC9C0\uD568\uC73C\uB85C\uC368 \uD6A8\uB825\uC774 \uBC1C\uC0DD\uD558\uBA70, \uBCC0\uACBD\uB41C \uC57D\uAD00\uC5D0 \uB3D9\uC758\uD558\uC9C0 \uC544\uB2C8\uD558\uB294 \uACBD\uC6B0\n3. \uC57D\uAD00 \uC678 \uC900\uCE59\n\uC774 \uC57D\uAD00\uC5D0 \uBA85\uC2DC\uB418\uC9C0 \uC54A\uC740 \uC0AC\uD56D\uC740 \uAD00\uACC4\uBC95\uB839\uC5D0 \uB530\uB985\uB2C8\uB2E4.\n4. \uC6A9\uC5B4\uC758 \uC815\uC758\n\u2460 \uC11C\uBE44\uC2A4\uB780 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0\uC11C \uC81C\uACF5\uD558\uB294 \uC544\uC774\uB514\uC5B4 \uAD00\uB828 \uC11C\uBE44\uC2A4 \uBC0F \uB9C8\uC77C\uB9AC\uC9C0 \uAD00\uB9AC, \uC81C\uBC18\uC815\uBCF4(\uCC3D\uC5C5\uC9C0\uC6D0, \uB274\uC2A4/\uC790\uB8CC\uC2E4, \uCEE4\uBBA4\uB2C8\uD2F0 \uB4F1)\uB97C \uB9D0\uD569\uB2C8\uB2E4.\n\u2461 \uD68C\uC6D0\uC774\uB780 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0 \uAC1C\uC778\uC815\uBCF4\uB97C \uC81C\uACF5\uD558\uACE0 \uD68C\uC6D0\uAC00\uC785\uC744 \uD55C \uC790\uB85C\uC11C, \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC81C\uACF5\uD558\uB294 \uBAA8\uB4E0 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD560 \uC218 \uC788\uB294 \uC8FC\uCCB4\uB97C \uB9D0\uD569\uB2C8\uB2E4.\n\u2462 \uBE44\uD68C\uC6D0\uC774\uB780 \uD68C\uC6D0\uC73C\uB85C \uAC00\uC785\uD558\uC9C0 \uC54A\uACE0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC81C\uACF5\uD558\uB294 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD558\uB294 \uC790\uB97C \uB9D0\uD569\uB2C8\uB2E4.\n\u2463 \uC774\uC6A9\uC790\uB780 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC81C\uACF5\uD558\uB294 \uC11C\uBE44\uC2A4\uB97C \uBC1B\uB294 \uD68C\uC6D0 \uBC0F \uBE44\uD68C\uC6D0\uC744 \uB9D0\uD569\uB2C8\uB2E4.\n5. \uD68C\uC6D0\uAC00\uC785\n\u2460 \uC774\uC6A9\uC790\uAC00 \uD68C\uC6D0\uAC00\uC785\uC744 \uC2E0\uCCAD\uD558\uB294 \uACBD\uC6B0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC815\uD55C \uC591\uC2DD\uC5D0 \uB530\uB77C \uD68C\uC6D0\uC815\uBCF4\uB97C \uAE30\uC785\uD55C \uD6C4 \uC774 \uC57D\uAD00\uC5D0 \uB3D9\uC758\uD55C\uB2E4\uB294 \uC758\uC0AC\uD45C\uC2DC\uB97C \uD568\uC73C\uB85C\uC368 \uD6A8\uB825\uC744 \uBC1C\uC0DD\uD569\uB2C8\uB2E4.\n\u2461 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \u2460\uD56D\uACFC \uAC19\uC774 \uD68C\uC6D0\uC73C\uB85C \uAC00\uC785\uD560 \uAC83\uC744 \uC2E0\uCCAD\uD55C \uC774\uC6A9\uC790 \uC911 \uB2E4\uC74C \uAC01 \uD638\uC5D0 \uD574\uB2F9\uD558\uC9C0 \uC54A\uB294 \uD55C \uD68C\uC6D0\uC73C\uB85C \uC778\uC815\uD569\uB2C8\uB2E4.\n- \uD5C8\uC704\uB85C \uAC00\uC785\uC2E0\uCCAD\uC744 \uD55C \uACBD\uC6B0\n- \uC911\uBCF5\uC73C\uB85C \uC2E0\uCCAD\uD558\uC5EC \uC774\uC6A9\uD558\uB294 \uACBD\uC6B0\n- \uACF5\uACF5\uC9C8\uC11C \uB610\uB294 \uBBF8\uD48D\uC591\uC18D\uC744 \uC800\uD574\uD560 \uBAA9\uC801\uC73C\uB85C \uC2E0\uCCAD\uD558\uC600\uC744 \uACBD\uC6B0\n- \uC774 \uC57D\uAD00\uC744 \uC704\uBC18\uD558\uAC70\uB098 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC6B4\uC601\uC5D0 \uD604\uC800\uD788 \uC9C0\uC7A5\uC774 \uC788\uB2E4\uACE0 \uD310\uB2E8\uB418\uB294 \uACBD\uC6B0\n- \uAE30\uD0C0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uAD00\uB9AC\uC790\uAC00 \uD544\uC694\uD558\uB2E4\uACE0 \uC778\uC815\uD558\uB294 \uACBD\uC6B0\n6. \uD68C\uC6D0\uC815\uBCF4\uC758 \uBCC0\uACBD\n\uD68C\uC6D0\uC740 \uD68C\uC6D0\uAC00\uC785 \uC2DC \uAE30\uC7AC\uD55C \uAC1C\uC778\uC815\uBCF4\uAC00 \uBCC0\uACBD\uB418\uC5C8\uC744 \uACBD\uC6B0 \uC628\uB77C\uC778\uC73C\uB85C \uC9C1\uC811 \uC218\uC815\uD558\uAC70\uB098 \uAD00\uB9AC\uC790\uC5D0\uAC8C \uC218\uC815\uC744 \uC694\uAD6C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC774\uB54C \uBCC0\uACBD\uD558\uC9C0 \uC54A\uC740 \uC815\uBCF4\uB85C \uC778\uD574 \uBC1C\uC0DD\uB418\uB294 \uBB38\uC81C\uC5D0 \uB300\uD55C \uCC45\uC784\uC740 \uD68C\uC6D0\uC5D0\uAC8C \uC788\uC2B5\uB2C8\uB2E4.\n7. \uD68C\uC6D0 \uD0C8\uD1F4 \uBC0F \uCDE8\uC18C\n\u2460 \uC774\uC6A9\uC790\uAC00 \uD68C\uC6D0\uD0C8\uD1F4\uB97C \uD558\uACE0\uC790 \uD558\uB294 \uB54C\uC5D0\uB294 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uD68C\uC6D0\uD0C8\uD1F4 \uC808\uCC28\uC5D0 \uC758\uD558\uAC70\uB098 \uC804\uD654\uB098 \uC804\uC790\uBA54\uC77C\uB4F1\uC744 \uD1B5\uD558\uC5EC \uC2E0\uCCAD\uC744 \uD574\uC57C \uD569\uB2C8\uB2E4.\n\u2461 \uD68C\uC6D0\uC5D0\uAC8C \uB2E4\uC74C \uAC01 \uD56D\uC5D0 \uD574\uB2F9\uD558\uB294 \uC0AC\uC720\uAC00 \uBC1C\uC0DD\uD558\uC600\uC744 \uACBD\uC6B0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uC0AC\uC804 \uD1B5\uBCF4 \uC5C6\uC774 \uD68C\uC6D0\uAC00\uC785\uC744 \uCDE8\uC18C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n- \uD0C0\uC778 \uD68C\uC6D0ID \uBC0F \uBE44\uBC00\uBC88\uD638\uB97C \uB3C4\uC6A9\uD55C \uACBD\uC6B0\n- \uD0C0\uC778\uC5D0\uAC8C \uD574\uB97C \uC785\uD788\uAC70\uB098 \uC785\uD790 \uC218 \uC788\uB294 \uD589\uC704\uB97C \uD558\uB294 \uACBD\uC6B0\n- \uC0AC\uD589\uD589\uC704 \uC870\uC7A5, \uC800\uC18D\u00B7\uC74C\uB780\uBB3C \uAC8C\uC2DC \uB4F1 \uACF5\uACF5\uC9C8\uC11C \uB610\uB294 \uBBF8\uD48D\uC591\uC18D\uC744 \uC800\uD574\uD558\uB294 \uD589\uC704\uB97C \uACC4\uD68D \uB610\uB294 \uC2E4\uD589\uD55C \uACBD\uC6B0\n- \uBD80\uB2F9\uD55C \uBC29\uBC95\uC73C\uB85C \uC815\uBCF4\uD1B5\uC2E0\uB9DD\uC5D0 \uC758\uD558\uC5EC \uCC98\uB9AC, \uBCF4\uAD00, \uC804\uC1A1\uB418\uB294 \uD0C0\uC778\uC758 \uC815\uBCF4\uB97C \uD6FC\uC190\uD558\uAC70\uB098 \uD0C0\uC778\uC758 \uAC1C\uC778\uC815\uBCF4\uB97C \uC218\uC9D1, \uC800\uC7A5, \uCE68\uD574, \uB3C4\uC6A9 \uB610\uB294 \uB204\uC124\uD558\uB294 \uD589\uC704\uB97C \uD558\uB294 \uACBD\uC6B0\n- \uBD88\uD544\uC694\uD558\uAC70\uB098 \uC2B9\uC778\uB418\uC9C0 \uC54A\uC740 \uAD11\uACE0, \uD310\uCD09\uBB3C \uAC8C\uC7AC, \uC815\uD06C\uBA54\uC77C, \uC2A4\uD338\uBA54\uC77C\uC744 \uBC1C\uC1A1\uD558\uB294 \uACBD\uC6B0\n- \uC218\uC2E0\uC790\uC758 \uBA85\uC2DC\uC801\uC778 \uC218\uC2E0\uAC70\uBD80 \uC758\uC0AC\uC5D0 \uBC18\uD558\uB294 \uAD11\uACE0\uC131 \uC804\uC790\uC6B0\uD3B8\uC744 \uC804\uC1A1\uD558\uB294 \uD589\uC704\uB97C \uD558\uB294 \uACBD\uC6B0\n- \uAD00\uB828 \uBC95\uB960\uC5D0\uC11C \uAE08\uC9C0\uD558\uB294 \uD589\uC704 \uB610\uB294 \uC774 \uC57D\uAD00\uC744 \uC704\uBC18\uD558\uB294 \uD589\uC704\uB97C \uD558\uB294 \uACBD\uC6B0\n- \uAE30\uD0C0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uAD00\uB9AC\uC790\uAC00 \uD544\uC694\uD558\uB2E4\uACE0 \uC778\uC815\uD558\uB294 \uACBD\uC6B0\n8. \uC11C\uBE44\uC2A4 \uC774\uC6A9\uC2DC\uAC04\n\u2460 \uAD00\uB9AC\uC790\uC758 \uC9C1\uC811\uC801\uC778 \uC9C0\uC6D0\uC744 \uBC1B\uC9C0 \uC54A\uB294 \uC11C\uBE44\uC2A4\uC758 \uC774\uC6A9\uC2DC\uAC04\uC740 \uC5C5\uBB34\uC0C1 \uB610\uB294 \uAE30\uC220\uC0C1 \uD2B9\uBCC4\uD55C \uC9C0\uC7A5\uC774 \uC5C6\uB294 \uD55C \uC5F0\uC911(1\uC77C 24\uC2DC\uAC04) \uC774\uC6A9\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uB2E4\uB9CC, \uCC9C\uC7AC\uC9C0\uBCC0, \uC2DC\uC2A4\uD15C\uC810\uAC80 \uB4F1\uC758 \uC0AC\uC720\uB85C \uC11C\uBE44\uC2A4\uB97C \uC911\uB2E8\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\u2461 \uAD00\uB9AC\uC790\uAC00 \uC9C1\uC811 \uC81C\uACF5\uD558\uB294 \uC11C\uBE44\uC2A4\uB294 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uADFC\uBB34\uC2DC\uAC04\uC744 \uC6D0\uCE59\uC73C\uB85C \uD569\uB2C8\uB2E4.\n9. \uC11C\uBE44\uC2A4 \uC81C\uACF5\uC758 \uC81C\uD55C \uBC0F \uC911\uB2E8\n\uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uB2E4\uC74C\uC758 \uACBD\uC6B0\uC5D0\uB294 \uC11C\uBE44\uC2A4 \uC81C\uACF5\uC744 \uC77C\uBD80 \uB610\uB294 \uC804\uBD80\uB97C \uC81C\uD55C\uD558\uAC70\uB098 \uC911\uB2E8\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC11C\uBE44\uC2A4 \uC911\uB2E8\uC73C\uB85C \uBC1C\uC0DD\uB418\uB294 \uBB38\uC81C\uC5D0 \uB300\uD558\uC5EC \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uCC45\uC784\uC744 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n- \uCC9C\uC7AC\uC9C0\uBCC0, \uAD6D\uAC00 \uBE44\uC0C1\uC0AC\uD0DC, \uC815\uBD80\uC608\uC0B0\uC758 \uBCC0\uACBD \uB4F1 \uAE30\uD0C0 \uBD88\uAC00\uD56D\uB825\uC758 \uC0AC\uC720\uAC00 \uBC1C\uC0DD\uD558\uAC70\uB098 \uBC1C\uC0DD\uD560 \uC6B0\uB824\uAC00 \uC788\uB294 \uACBD\uC6B0\n- \uC11C\uBE44\uC2A4\uC6A9 \uC124\uBE44\uC758 \uBCF4\uC218, \uACF5\uC0AC \uB610\uB294 \uC7A5\uC560\uB85C \uC778\uD55C \uACBD\uC6B0\n- \uC11C\uBE44\uC2A4 \uC774\uC6A9\uC758 \uD3ED\uC8FC \uB4F1\uC73C\uB85C \uC774\uC6A9\uC5D0 \uC9C0\uC7A5\uC774 \uC788\uC744 \uACBD\uC6B0 - \uAE30\uAC04\uD1B5\uC2E0\uC0AC\uC5C5\uC790\uAC00 \uC804\uAE30\uD1B5\uC2E0\uC11C\uBE44\uC2A4\uB97C \uC911\uC9C0\uD588\uC744 \uACBD\uC6B0\n- \uAE30\uD0C0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uAD00\uB9AC\uC790\uAC00 \uD544\uC694\uD558\uB2E4\uACE0 \uC778\uC815\uD558\uB294 \uACBD\uC6B0\n10. \uC11C\uBE44\uC2A4\uC758 \uBCC0\uACBD \uBC0F \uD68C\uC6D0 \uC11C\uBE44\uC2A4\n\u2460 \uC774\uC6A9\uC790\uC5D0 \uB300\uD55C \uC11C\uBE44\uC2A4\uC758 \uB0B4\uC6A9\uC740 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC815\uCC45\uC5D0 \uC758\uD574 \uACB0\uC815\uB418\uBA70 \uBCC0\uACBD \uB610\uB294 \uC911\uB2E8\uB420 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\u2461 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uC774 \uC57D\uAD00\uC744 \uC900\uC218\uD558\uB294 \uC774\uC6A9\uC790 \uBAA8\uB450\uC5D0\uAC8C \uBAA8\uB4E0 \uC815\uBCF4\uC640 \uC11C\uBE44\uC2A4\uB97C \uBB34\uB8CC\uB85C \uC81C\uACF5\uD558\uB294 \uAC83\uC744 \uC6D0\uCE59\uC73C\uB85C \uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uB2E4\uB9CC \uC77C\uBD80 \uC11C\uBE44\uC2A4\uB294 \uD68C\uC6D0\uAC00\uC785\uC744 \uD55C \uD68C\uC6D0\uC5D0 \uD55C\uD558\uC5EC \uC81C\uACF5\uB418\uB294 \uC11C\uBE44\uC2A4\uAC00 \uC788\uC2B5\uB2C8\uB2E4.\n- \uAE00\uC4F0\uAE30 \uAD8C\uD55C : \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0 \uC6B4\uC601\uD558\uB294 \uAC8C\uC2DC\uD310\uC740 \uD68C\uC6D0\uC5D0 \uD55C\uD574 \uAE00\uC4F0\uAE30 \uBC0F \uC0C1\uB2F4\uC5D0 \uB300\uD55C \uAD8C\uD55C\uC774 \uC8FC\uC5B4\uC9D1\uB2C8\uB2E4.\n- \uB9C8\uC774\uD398\uC774\uC9C0 : \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC81C\uACF5\uD558\uB294 \uC815\uBCF4 \uC911 \uAC1C\uC778\uC801\uC73C\uB85C \uBCC4\uB3C4 \uBCF4\uAD00\uD560 \uD544\uC694\uAC00 \uC788\uB294 \uC815\uBCF4\uB97C \uC800\uC7A5\uD560 \uC218 \uC788\uB3C4\uB85D \uC9C0\uC6D0\uD558\uB294 \uC11C\uBE44\uC2A4\uC785\uB2C8\uB2E4.\n11. \uAD11\uACE0\uC758 \uAC8C\uC7AC\n\u2460 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC11C\uBE44\uC2A4\uC758 \uC6B4\uC601 \uBC0F \uC815\uBCF4\uC81C\uACF5\uACFC \uAD00\uB828\uD558\uC5EC \uC11C\uBE44\uC2A4 \uD654\uBA74, \uD648\uD398\uC774\uC9C0, \uC804\uC790\uC6B0\uD3B8 \uB4F1\uC5D0 \uAD11\uACE0 \uB4F1\uC744 \uAC8C\uC7AC\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\u2461 \uC774\uC6A9\uC790\uAC00 \uC11C\uBE44\uC2A4\uC0C1\uC5D0 \uAC8C\uC7AC\uB418\uC5B4 \uC788\uAC70\uB098 \uC11C\uBE44\uC2A4\uB97C \uD1B5\uD55C \uAD11\uACE0\uC8FC\uC758 \uD310\uCD09\uD65C\uB3D9\uC5D0 \uCC38\uC5EC\uD558\uAC70\uB098 \uB610\uB294 \uAC70\uB798\uB97C \uD558\uB294 \uAC83\uC740 \uC804\uC801\uC73C\uB85C \uC774\uC6A9\uC790\uC640 \uAD11\uACE0\uC8FC\uAC04\uC758 \uBB38\uC81C\uC785\uB2C8\uB2E4. \uB530\uB77C\uC11C, \uB9CC\uC57D \uC774\uC6A9\uC790\uC640 \uAD11\uACE0\uC8FC\uAC04\uC5D0 \uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD560 \uACBD\uC6B0\uC5D0\uB3C4 \uC774\uC6A9\uC790\uC640 \uAD11\uACE0\uC8FC\uAC00 \uC9C1\uC811 \uD574\uACB0\uD558\uC154\uC57C \uD558\uBA70, \uC774\uC640 \uAD00\uB828\uD558\uC5EC \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC5B4\uB5A0\uD55C \uCC45\uC784\uB3C4 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n12. \uCEE8\uD150\uCE20\n\u2460 \uCEE8\uD150\uCE20\uC758 \uC815\uD655\uC131, \uC548\uC815\uC131, \uB610\uB294 \uD488\uC9C8 \uB4F1\uACFC \uAD00\uB828\uD558\uC5EC \uC758\uBB38\uC0AC\uD56D\uC774 \uC788\uC73C\uC2DC\uBA74 \uC9C1\uC811 \uCEE8\uD150\uCE20\uB97C \uB9CC\uB4E0 \uC790\uC5D0\uAC8C \uBB38\uC758\uD558\uC2DC\uAE30 \uBC14\uB78D\uB2C8\uB2E4. \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uCEE8\uD150\uCE20\uC758 \uC815\uD655\uC131, \uC548\uC804\uC131 \uB4F1\uACFC \uAD00\uB828\uD558\uC5EC \uCC45\uC784\uC744 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n\u2461 \uC774\uC6A9\uC790\uAC00 \uAC8C\uC2DC\uD55C \uCEE8\uD150\uCE20\uC758 \uB0B4\uC6A9\uC5D0 \uB300\uD55C \uAD8C\uB9AC\uC640 \uCC45\uC784\uC740 \uD574\uB2F9 \uC774\uC6A9\uC790\uC5D0\uAC8C \uC788\uC2B5\uB2C8\uB2E4.\n\u2462 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uC774\uC6A9\uC790\uAC00 \uAC8C\uC2DC\uD55C \uCEE8\uD150\uCE20\uB97C \uC0AC\uC804 \uD1B5\uC9C0 \uC5C6\uC774 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uB0B4\uC5D0\uC11C \uD3B8\uC9D1, \uC774\uB3D9\uD560 \uC218 \uC788\uB294 \uAD8C\uB9AC\uB97C \uBCF4\uC720\uD558\uBA70, \uBE44\uC0C1\uC5C5\uC801 \uBAA9\uC801\uC73C\uB85C \uC774\uC6A9\uC790\uC758 \uCEE8\uD150\uCE20\uB97C \uD65C\uC6A9\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\u2463 \uB2E4\uC74C\uC758 \uACBD\uC6B0 \uC0AC\uC804 \uD1B5\uC9C0 \uC5C6\uC774 \uCEE8\uD150\uCE20\uB97C \uC0AD\uC81C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n- \uD0C0\uC778\uC5D0\uAC8C \uD574\uB97C \uC785\uD788\uAC70\uB098 \uC785\uD790 \uC218 \uC788\uB294 \uB0B4\uC6A9\uC744 \uD3EC\uD568\uD55C \uACBD\uC6B0\n- \uBD88\uBC95, \uC74C\uB780, \uC800\uC18D\uD558\uB2E4\uACE0 \uD310\uB2E8\uB418\uB294 \uAC8C\uC2DC\uBB3C\uC744 \uAC8C\uC2DC\uD55C \uACBD\uC6B0\n- \uB2E4\uB978 \uC774\uC6A9\uC790 \uB610\uB294 \uC81C3\uC790\uB97C \uBE44\uBC29\uD558\uAC70\uB098 \uBA85\uC608\uB97C \uC190\uC0C1\uC2DC\uD0A4\uB294 \uB0B4\uC6A9\uC778 \uACBD\uC6B0\n- \uACF5\uACF5\uC9C8\uC11C \uBC0F \uBBF8\uD48D\uC591\uC18D\uC5D0 \uC704\uBC18\uB418\uB294 \uB0B4\uC6A9\uC778 \uACBD\uC6B0\n- \uBC94\uC8C4\uC801 \uD589\uC704\uC5D0 \uACB0\uBD80\uB41C\uB2E4\uACE0 \uC778\uC815\uB418\uB294 \uB0B4\uC6A9\uC778 \uACBD\uC6B0\n- \uC81C3\uC790\uC758 \uC800\uC791\uAD8C \uB4F1 \uAE30\uD0C0 \uAD8C\uB9AC\uB97C \uCE68\uD574\uD558\uB294 \uB0B4\uC6A9\uC778 \uACBD\uC6B0\n- \uAD00\uB828 \uBC95\uB960\uC5D0\uC11C \uAE08\uC9C0\uD558\uB294 \uD589\uC704 \uB610\uB294 \uBCF8 \uC11C\uBE44\uC2A4\uC758 \uC57D\uAD00\uC758 \uB0B4\uC6A9\uC5D0 \uC704\uBC30\uB418\uB294 \uACBD\uC6B0\n- \uAE30\uD0C0 \uC801\uC808\uD558\uC9C0 \uBABB\uD55C \uB0B4\uC6A9\uC744 \uB2F4\uACE0 \uC788\uB294 \uB4F1 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uAD00\uB9AC\uC790\uAC00 \uD544\uC694\uD558\uB2E4\uACE0 \uC778\uC815\uD558\uB294 \uACBD\uC6B0\n13. \uB9C1\uD06C\n\uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC81C3\uC790\uC758 \uC6F9\uC0AC\uC774\uD2B8 \uB610\uB294 \uC790\uB8CC\uC5D0 \uB300\uD55C \uB9C1\uD06C\uB97C \uC81C\uACF5\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n\uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uADF8\uB7EC\uD55C \uC0AC\uC774\uD2B8 \uBC0F \uC790\uB8CC\uC5D0 \uB300\uD55C \uD1B5\uC81C\uAD8C\uC774 \uC5C6\uC73C\uBBC0\uB85C \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0\uAC8C \uACE0\uC758\uB098 \uC911\uACFC\uC2E4\uC774 \uC778\uC815\uB420 \uB9CC\uD55C \uD2B9\uBCC4\uD55C \uC0AC\uC720\uAC00 \uC788\uB294 \uACBD\uC6B0\uB97C \uC81C\uC678\uD558\uACE0\uB294 \uB9C1\uD06C\uB41C \uC0AC\uC774\uD2B8 \uBC0F \uC790\uB8CC\uC758 \uB0B4\uC6A9, \uAD11\uACE0, \uC81C\uD488 \uB4F1\uC5D0 \uB300\uD574 \uCC45\uC784\uC744 \uBD80\uB2F4\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n14. \uC774\uC6A9\uC790\uC758 \uC758\uBB34\n\u2460 \uC774\uC6A9\uC790\uB294 \uAD00\uACC4 \uBC95\uB839, \uBCF8 \uC57D\uAD00\uC758 \uADDC\uC815, \uC774\uC6A9\uC548\uB0B4 \uBC0F \uC11C\uBE44\uC2A4\uC0C1\uC5D0 \uACF5\uC9C0\uD55C \uC8FC\uC758\uC0AC\uD56D, \uAE30\uD0C0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uD1B5\uC9C0\uD558\uB294 \uC0AC\uD56D\uC744 \uC900\uC218\uD558\uC5EC\uC57C \uD558\uBA70, \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC5C5\uBB34\uC5D0 \uBC29\uD574\uB418\uB294 \uD589\uC704\uB97C \uD558\uC5EC\uC11C\uB294 \uC548\uB429\uB2C8\uB2E4.\n\u2461 \uC774\uC6A9\uC790\uB294 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD558\uC5EC \uC5BB\uC740 \uC815\uBCF4\uB97C \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC0AC\uC804 \uC2B9\uB099 \uC5C6\uC774 \uBCF5\uC0AC, \uBCF5\uC81C, \uBCC0\uACBD, \uBC88\uC5ED, \uCD9C\uD310, \uBC29\uC1A1 \uAE30\uD0C0\uC758 \uBC29\uBC95\uC73C\uB85C \uC0AC\uC6A9\uD558\uAC70\uB098 \uC774\uB97C \uD0C0\uC778\uC5D0\uAC8C \uC81C\uACF5\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4.\n\u2462 \uC774\uC6A9\uC790\uB294 \uBCF8\uC778\uC758 \uCC45\uC784 \uD558\uC5D0 ID\uC640 \uBE44\uBC00\uBC88\uD638\uC758 \uBCF4\uC548\uC744 \uC720\uC9C0\uD558\uC154\uC57C \uD558\uBA70, \uC790\uC2E0\uC758 ID\uC640 \uBE44\uBC00\uBC88\uD638\uB97C \uC0AC\uC6A9\uD558\uC5EC \uBC1C\uC0DD\uD558\uB294 \uBAA8\uB4E0 \uACB0\uACFC\uC5D0 \uB300\uD574 \uC804\uC801\uC778 \uCC45\uC784\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uBCF8\uC778\uC758 \uC2B9\uC778 \uC5C6\uC774 ID\uB098 \uBE44\uBC00\uBC88\uD638\uAC00 \uC0AC\uC6A9\uB418\uB294 \uB4F1 \uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD558\uC2DC\uBA74 \uC989\uC2DC \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0 \uC2E0\uACE0\uD558\uC154\uC57C \uD569\uB2C8\uB2E4. \uB610\uD55C \uBD80\uC5EC\uBC1B\uC740 ID \uBC0F \uBE44\uBC00\uBC88\uD638\uB294 \uD0C0\uC778\uC5D0\uAC8C \uC804\uB9E4 \uB610\uB294 \uC591\uB3C4\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4.\n\u2463 \uC774\uC6A9\uC790\uB294 \uC11C\uBE44\uC2A4 \uC774\uC6A9\uC744 \uC704\uD574 \uD68C\uC6D0\uC73C\uB85C \uAC00\uC785\uD560 \uACBD\uC6B0 \uD604\uC7AC\uC758 \uC0AC\uC2E4\uACFC \uC77C\uCE58\uD558\uB294 \uC644\uC804\uD55C \uC815\uBCF4\uB97C \uC81C\uACF5\uD558\uC154\uC57C \uD558\uBA70, \uC644\uB8CC\uC815\uBCF4\uC5D0 \uBCC0\uACBD\uC0AC\uD56D\uC774 \uBC1C\uC0DD\uD560 \uACBD\uC6B0 \uC989\uC2DC \uAC31\uC2E0\uD558\uC154\uC57C \uD569\uB2C8\uB2E4.\n\u2464 \uC774\uC6A9\uC790\uB294 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uC81C\uACF5\uD558\uB294 \uC815\uBCF4\uC640 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD558\uC5EC \uC601\uC5C5\uD65C\uB3D9\uC744 \uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4.\n15. \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC758 \uC758\uBB34\n\u2460 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC774\uC6A9\uC790\uAC00 \uC548\uC815\uC801\uC73C\uB85C \uC11C\uBE44\uC2A4\uB97C \uBC1B\uC744 \uC218 \uC788\uB3C4\uB85D \uD56D\uC0C1 \uB178\uB825\uD569\uB2C8\uB2E4.\n\u2461 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC815\uBCF4\uD1B5\uC2E0\uC774\uC6A9\uCD09\uC9C4\uC5D0\uAD00\uD55C\uBC95\uB960, \uC804\uAE30\uD1B5\uC2E0\uAE30\uBCF8\uBC95 \uB4F1 \uC11C\uBE44\uC2A4\uC758 \uC6B4\uC601,\uC720\uC9C0\uC640 \uAD00\uB828 \uC788\uB294 \uBC95\uADDC\uB97C \uC900\uC218\uD569\uB2C8\uB2E4.\n16. \uAC1C\uC778\uC815\uBCF4\uC758 \uBCF4\uD638\n\u2460 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uD68C\uC6D0\uC758 \uC815\uBCF4\uB97C \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC744 \uC6B4\uC601\uD558\uAC70\uB098 \uAC1C\uC120\uD558\uB294 \uBAA9\uC801\uC73C\uB85C\uB9CC \uC0AC\uC6A9\uD569\uB2C8\uB2E4.\n\u2461 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uAC00 \uCDE8\uB4DD\uD55C \uD68C\uC6D0\uC815\uBCF4\uB294 \uBCF8\uC778\uC758 \uC2B9\uB099 \uC5C6\uC774 \uC81C3\uC790\uC5D0\uAC8C \uACF5\uAC1C\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n\u2462 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC774\uC6A9\uC790\uC758 \uAC1C\uC778\uC815\uBCF4\uB97C \uB9E4\uC6B0 \uC911\uC694\uD558\uAC8C \uB2E4\uB8E8\uACE0 \uC788\uC2B5\uB2C8\uB2E4.\n17. \uAC1C\uC778\uC815\uBCF4\uC758 \uACF5\uAC1C\n\uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC740 \uB2E4\uC74C\uACFC \uAC19\uC740 \uACBD\uC6B0\uC5D0 \uBC95\uC5D0\uC11C \uD5C8\uC6A9\uD558\uB294 \uBC94\uC704 \uB0B4\uC5D0\uC11C \uC774\uC6A9\uC790\uC758 \uC131\uBA85, \uC804\uC790\uC6B0\uD3B8\uC8FC\uC18C \uB4F1 \uAC1C\uC778\uC815\uBCF4\uB97C \uC81C3\uC790\uC5D0\uAC8C \uC81C\uACF5\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.\n- \uC774\uC6A9\uC790\uAC00 \uC11C\uBE44\uC2A4\uB97C \uC774\uC6A9\uD568\uC5D0 \uC788\uC5B4 \uAD00\uB828 \uBC95\uB960\uC744 \uC704\uBC18\uD558\uC5EC \uC218\uC0AC\uAE30\uAD00\uC774\uB098 \uAE30\uD0C0 \uC815\uBD80\uAE30\uAD00\uC73C\uB85C\uBD80\uD130 \uC815\uBCF4\uC81C\uACF5\uC744 \uC694\uCCAD \uBC1B\uB294 \uACBD\uC6B0\n- \uC774\uC6A9\uC790\uC758 \uBC95\uB960\uC704\uBC18, \uBCF8 \uC57D\uAD00\uC704\uBC18\uC744 \uD3EC\uD568\uD558\uC5EC \uBD80\uC815\uD589\uC704 \uC644\uB8CC \uB4F1\uC758 \uC815\uBCF4\uBCF4\uD638\uC5C5\uBB34\uB97C \uC704\uD574 \uD544\uC694\uD55C \uACBD\uC6B0\n- \uAE30\uD0C0 \uBC95\uB960\uC5D0 \uC758\uD574 \uC694\uAD6C\uB418\uB294 \uACBD\uC6B0\n18. \uBA74\uCC45\uC870\uD56D\n\u2460 \uC774\uC6A9\uC790\uAC00 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uC11C\uBE44\uC2A4 \uC81C\uACF5\uC73C\uB85C\uBD80\uD130 \uAE30\uB300\uB418\uB294 \uC774\uC775\uC744 \uC5BB\uC9C0 \uBABB\uD558\uC600\uAC70\uB098 \uC11C\uBE44\uC2A4\uC790\uB8CC\uC5D0 \uB300\uD55C \uCDE8\uC0AC\uC120\uD0DD \uB610\uB294 \uC774\uC6A9\uC73C\uB85C \uBC1C\uC0DD\uD558\uB294 \uC190\uC775\uC5D0 \uB300\uD558\uC5EC \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uCC45\uC784\uC744 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n\u2461 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC774\uC6A9\uC790\uC758 \uADC0\uCC45\uC0AC\uC720\uB85C \uC778\uD55C \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uC774\uC6A9\uC758 \uC7A5\uC560\uC5D0 \uB300\uD558\uC5EC \uCC45\uC784\uC744 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n\u2462 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uB294 \uC774\uC6A9\uC790\uAC00 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0\uC5D0 \uAC8C\uC2DC\uD558\uAC70\uB098 \uB610\uB294 \uC804\uC1A1\uD55C \uB0B4\uC6A9\uC5D0 \uAD00\uD558\uC5EC\uB294 \uCC45\uC784\uC744 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n\u2463 \uC774\uC6A9\uC790 \uC0C1\uD638\uAC04 \uB610\uB294 \uC774\uC6A9\uC790\uC640 \uC81C3\uC790 \uC0C1\uD638\uAC04\uC5D0 \uBE45\uB370\uC774\uD130 \uC544\uC774\uB514\uC5B4 \uB9C8\uC77C\uB9AC\uC9C0 \uC11C\uBE44\uC2A4\uB97C \uB9E4\uAC1C\uB85C \uD55C \uBB3C\uD488\uAC70\uB798, \uAE08\uC804\uAC70\uB798 \uB4F1\uACFC \uAD00\uB828\uD558\uC5EC \uBC1C\uC0DD\uD55C \uBB38\uC81C\uC5D0 \uB300\uD558\uC5EC \uC5B4\uB5A0\uD55C \uCC45\uC784\uB3C4 \uC9C0\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.\n19. \uAD00\uD560\uBC95\uC6D0\n\uBCF8 \uC11C\uBE44\uC2A4 \uC774\uC6A9\uACFC \uAD00\uB828\uD558\uC5EC \uBC1C\uC0DD\uD55C \uBD84\uC7C1\uC5D0 \uB300\uD574 \uC18C\uC1A1\uC774 \uC81C\uAE30\uB420 \uACBD\uC6B0 \uAC15\uC6D0\uD14C\uD06C\uB178\uD30C\uD06C \uBCF8\uBD80 \uC18C\uC7AC\uC9C0\uB97C \uAD00\uD560\uD558\uB294 \uBC95\uC6D0\uC744 \uAD00\uD560 \uBC95\uC6D0\uC73C\uB85C \uD569\uB2C8\uB2E4.\n          ");
